import "./toggle.css"

const Toggle = () => { 
    
    return (
        <div className="t">
            <img src="./images/sun.png" alt="" className="t-icon" />
            <img src="./images/moon.png" alt="" className="t-icon" />
            <div className="t-button"></div>
                                                                             
        </div>
    )
}

export default Toggle
